import React, { useState, useEffect } from 'react'
import{Navigate, useNavigate} from 'react-router-dom'
function Dashboard({user}) {
  const people = [
    { name: "Sarah", age: "22", gender: "Female" },
    { name: "Mike", age: "30", gender: "Male" },
    { name: "Anna", age: "20", gender: "Female" },
    { name: "Sarah", age: "22", gender: "Female" },
    { name: "Mike", age: "30", gender: "Male" },
    { name: "Anna", age: "20", gender: "Female" },
  ];
  const [data, setData] = useState(people)
  const femaleFilter = () =>{
    let peopleGender = people.filter(i => i.gender === 'Female')
    setData(peopleGender)
  }
 
  const maleFilter = () =>{
    let peopleGender = people.filter(i => i.gender === 'Male')
    setData(peopleGender)
  }
    // if(user){
    //     return <h1>Welcome to your dashboard {user.name}!</h1>
    // }
    const navigate = useNavigate();
    useEffect(()=>{
        if(!user){
            navigate('/babyplanner')
        }
    },[]);
    
  return (
    <div>Dashboard
      <p onClick={femaleFilter}>Female</p>
      <p onClick={maleFilter}>Male</p>
      <Dashboard data ={data}/>
      {data.map((i) => (
            <div className='aboutContent'>
              <div className='name'> {i.name}</div>
              <div className='age'> {i.age}</div>
              <div className='gender'> {i.gender}</div>
            </div>
          ))}
    </div>
  )
}

export default Dashboard
